# --------------------------------
# 1. Query with all needed data 
# - grabs last row (most recent) data for each person's academic and work history since there is repeating input for every year 
# - for future: want this to be automatically update when parent file gets updated so we won't have to delete table and rerun this query 
WITH LatestAcademicHistory AS (
    SELECT 
        ContactID, 
        FieldOfStudy, 
        GraduationYear,
        ROW_NUMBER() OVER (PARTITION BY ContactID ORDER BY GraduationYear DESC) AS rn
    FROM 
        AcademicHistory
),
LatestWorkHistory AS (
    SELECT 
        ContactID, 
        Designation, 
        CompanyName, 
        ROW_NUMBER() OVER (PARTITION BY ContactID ORDER BY UpdateDate DESC) AS rn
    FROM 
        WorkHistory
)
SELECT 
    cm.ContactID, 
    CONCAT(cm.First, ' ', cm.Last) AS FullName, 
    lah.FieldOfStudy, 
    CAST(lah.GraduationYear AS CHAR) AS GraduationYear, 
    CONCAT(lwh.Designation, ' @ ', lwh.CompanyName) AS JobTitle, 
    cm.LinkedInUrl
FROM 
    ContactMaster cm
JOIN 
    LatestAcademicHistory lah ON cm.ContactID = lah.ContactID AND lah.rn = 1
JOIN 
    LatestWorkHistory lwh ON cm.ContactID = lwh.ContactID AND lwh.rn = 1
ORDER BY 
    cm.ContactID;

