(5, 2, 'Very Good Security', 'United States', NULL, NULL, 'Full-Cycle Outbound Closing Role (Land & Expand). Focus in SME segment and below (0-2500 employees)\r\n\r\nResponsible for entire sales motion (Land and Expand), POC management, outside prospecting, coaching and managing new SDR team, fielding inbound inquiries, and creating new channel partnerships.\r\n\r\n2022 Achievements (Q3 & Q4):\r\n- New Logos 27 (1 Enterprise, 4 MidMarket, 22 SMB)\r\n- FY \'22 - 135% Quota Attainment\r\n- Blended pipeline generation sourced from field event selling, outbound prospecting, part', 'Account Executive - Global SME & Partnership Channel', '2022-12-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(6, 2, 'Very Good Security', 'Remote - Los Angeles', NULL, NULL, 'Full-cycle Outbound Closing role within the \"Data Security as a Service\" Niche.\r\nSMB segment and below (0-250 employees)\r\n\r\nPromotion from ISR grew role responsibilities to include outside prospecting, building pipeline funnel from the top down, fielding inbound inquiries, aligning needs to our descoping solution, and closing deals within a defined timeline for accurate business forecasting.\r\n\r\n- See AE Description for Quota attainment.', 'Outside Sales Representative - SMB', '2022-09-01', '2022-12-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(7, 2, 'Very Good Security', 'Remote - Los Angeles', NULL, NULL, 'Full-cycle Inbound Closing role in the SMB segment (0-100 employees)\r\n\r\nResponsible for fielding inbound inquiries, aligning needs to our descoping solution, managing prospect sandbox usage, overseeing customer move to production, & upselling existing customer base.\r\n\r\n- First deal close within first 4 weeks of selling\r\n- See AE Description for Quota Attainment', 'Inside Sales Representative - SMB', '2022-07-01', '2022-09-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(8, 2, 'Tanium', NULL, NULL, NULL, 'Elevated role within SMB/Mid-market (750 to 7,500 employees), focused on sourcing opportunities, managing channel & Ecosystem partner relationships, progressing pipeline to proof of concept, and co-closing deals.\r\n\r\nCurrent FY22 Pipeline (as of May 22): $2,789,000', 'Sr. Sales Development Executive - West Team Lead', '2022-05-01', '2022-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(9, 2, 'Tanium', 'California', 'United States', NULL, 'An evolved SDR role once supporting Enterprise and Big Enterprise (10,000 - 50,000 seats / 50,000+ seats), now supporting the Mid Market (1,000 - 10,000) seats in SoCal.\r\n\r\nResponsible for building trusting relationships, aligning problems with our technical solutions, and revealing the value Tanium offers to our customers. Austin cold sources opportunities, manages and maps channel ecosystem partners, hosts initial discovery calls and demos, prepares pipeline generating events in territory, and p', 'Sales Development Executive - West Team Lead', '2021-02-01', '2022-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(10, 2, 'Protiviti', 'Los Angeles', 'California', 'United States', '- Organized, documented, and tested ~250+ client controls to ensure that business processes and configurations are working appropriately and minimizing risk.\r\n- Improved Internal Talent Management reporting by automating the structuring, formatting, and inputs of eleven (11) reports to increase the efficiency of the reporting process.\r\n- Scheduled in-person meetings with client contacts to gather needed documents, explore and understand known problems, and identify opportunities for project expans', 'Experienced Tech/IT Consultant (Consultant II)', '2021-01-01', '2021-02-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(11, 2, 'Protiviti', 'Los Angeles', 'California', 'United States', NULL, 'Tech/IT Consultant (Consultant I)', '2020-01-01', '2021-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(12, 2, 'Protiviti', 'Los Angeles', 'California', NULL, 'As an intern at Protiviti, you will be responsible and held to the expectations of an entry level consultant, which includes many opportunities to add value while developing skills any consultant should possess', 'Foundations Consultant', '2019-06-01', '2019-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(13, 2, 'Loyola Marymount University', 'Los Angeles', 'California', NULL, '- Assisted fellow student athletes with tough course material, specifically Production Operations.\r\n- Established a study plan with the students to foster continuous learning.\r\n- Documented session results and notable metrics to validate that sessions were useful to the student.', 'AIMS IT Production Operations Athletic Tutor', '2019-09-01', '2019-12-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(14, 2, 'Loyola Marymount University', 'Los Angeles', 'California', 'United States', '- Collaborated with a classmate and client, VASO Group (a marketing and analytics agency for Amazon retailers), to create an automation solution to a business problem in a 8 month project.\r\n- Utilized Talend ETL, MySQL and Amazon RDS, and Python to automate a data extraction process from Amazon’s vendor platform (Vendor Central) to cloud storage. Used a visualization tool (Tableau Online) for historical record keeping and querying to be done by our client. \r\n- Project partner: Peter Gurka\r\n- Projec', 'LMU AIMS Capstone', '2018-08-01', '2019-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(15, 2, 'Loyola Marymount University', 'Greater Los Angeles Area', NULL, NULL, '2 year member on the executive board for marketing with SAAC (Student Athlete Advisory Community). The purpose of this committee is to foster community within LMU athletics, plan social or charity events to raise money, and discuss important rules/guidelines/policies that affect athletes both locally and throughout the United States.', 'SAAC Executive Board & Marketing Chair', '2017-02-01', '2019-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(16, 2, 'Loyola Marymount University', 'LMU', NULL, NULL, 'Year-round practice and seasonal competition. 4-year starter that led the team in assists in final two seasons and broke the assist record 2019. Every day was an opportunity to get 1% better, grow leadership skills, and practice discipline.', 'Division 1 Water Polo - Sr. Captain / Academic All American', '2016-08-01', '2020-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(17, 2, 'California Pizza Kitchen', 'Playa Vista', 'Los Angeles', NULL, 'Worked and added value in the CPK IT department by recording tech inventory levels, building restaurant manager workstations, organizing an in-house IT lab, and solving complex tech issues with restaurant managers over the phone', 'IT helpdesk intern', '2018-06-01', '2018-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(18, 2, 'Orange County Water Polo Club', 'Orange County', 'California', 'United States', NULL, 'Club Student Athlete', '2009-09-01', '2016-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(19, 3, 'Lantern', 'Boston', 'Massachusetts', 'United States', '- A seed startup with a focus in social equity, Lantern’s mission is to bring transparency, equity, and access to cannabis as the on-demand provider for cannabis products to all consumers, recreational and medical. \n- Led the website design vision and consumer-facing experiences for Lanternnow.com as the sole Product Designer on the team\n- Created and managed the company\'s first evolving design library, defining the company-wide design system and building prototypes to provide visualization to stakeholders\n- Performed user research and utilized site analytics to make informed design and product decisions, delivering tech-enabled digital experiences to end users\n- Worked closely with product and engineering teams in two-week sprints, leading redesigns for website pages to drive organic traffic and increase active user engagement\n- Collaborated with cross-functional teams to craft visual assets and content for email marketing, social media, and website materials', 'Product Designer', '2022-08-01', '2023-02-01', 'N', '2024-01-26 22:44:14', '2024-01-27 19:39:37'),
