(65, 8, 'Niagara Bottling', 'Diamond Bar', 'California', 'United States', '-Triaged critical production issues, handled ad-hoc requests, and delivered continuous improvement for production planning department.\n\n-Developed Business Requirement Documents for technology improvements along with creating the User Acceptance Test criteria and testing new functionality before deploying it to production environments.\n\n-Established scopes, oversaw timelines, and calculated cost and time savings for continuous improvement projects saving hundreds of hours and millions of dollars annually for Niagara.\n\n-Solved numerous production issues ranging from low to critical to ensure minimal impact of the dozens of team members along with prioritizing and communicating the impacts of those issues with the department.\n\n-Developed and maintained several BOTs (through the Automation Anywhere software) to reduce manual work of team members and to construct ETL workflows.\n\n-Implemented Standard Operating Procedures, and spearheaded trainings of new processes within production plannin', 'Continuous Improvement Analyst - Supply Chain', '2020-06-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-27 19:40:05'),
