(484, 75, 'Tokio Marine HCC - Cyber & Professional Lines Group', 'Encino', 'California', NULL, '- Implemented Snowflake database solution to control the quantity of granular data, reducing storage and processing costs while improving performance and uptime of the application.\n\n- Developed a process to keep the oldest/current data captured, scheduled to run on a daily cadence.\n\n- Transferred MS Excel-based approach to Power BI to create and publish a daily updated report that connects to the Snowflake, leveraging the aesthetic and graphical user interface benefits of Power BI.\n\n- Documented and cataloged SQL/Snowflake queries, stored procedures, tasks, data dictionary, Power BI expressions and annotations, and data quality issue annotations using data.world to improve data governance and ensure reporting logic can be shared or restored in case of unforeseen events.', 'Intern - Cyber & Professional Lines Group', '2022-11-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-27 18:27:12'),
