(962, 158, 'Vance & Hines', 'Hybrid Remote - Los Angeles', NULL, NULL, 'eCommerce Website, 30+ Product Launches, Two New Product Markets\n• Budget & Manage Marketing Dept: Graphic Designers, Photographers/Videographers, Web Dev/Server Techs, Social, Fabricator, and Electronics Dev.\n• Designed Company’s first DTC eCommerce website, including opt in for email subscription and live chat features (Syspro integrated and fully responsive).\n• Produce large, on-location product launch videos for website, internet and event truck displays.\n• Produced numerous in-studio how-to and interview videos including budgeting, scheduling, and hiring.\n• Launched 43-year old company into two new major markets: SxS and Soon-to-be-Announced.\n• Event planning, including numerous designs for truck product display, graphic wall, T-stand display, sandwich boards, brochures/catalogs/postcards and merchandise.\n• Magazine and social media ad design, and email campaign development.\n• Coordinate with outside contractors such as the publicist for press releases and race photographers.', 'Head of Marketing', '2021-11-01', '2022-11-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(963, 158, 'Perel Media Digital Agency', 'Remote', NULL, NULL, 'Team leader for 360° Marketing teams on projects such brand renovation, modernizing websites, web apps, promotional videos, digital & traditional marketing assets, and Social Media & eMail campaigns. Responsibilities include client relations, budgeting, proposals, website design, SEO architecture, wireframe development, copy writing, brand development, brand governance, content creation, email campaign design, social media marketing design, and video production from prep through post.', 'Marketing Agency President', '2015-09-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
