(1001, 162, 'Loyola Marymount University', 'Department of Public Safety', NULL, NULL, '•	Serve as LMU’s Jeanne Clery Act compliance officer. Responsible for all required compliance reporting, identification of Clery reporters across the university, and all required training for university personnel related to the Act.\n•	Serve as Annual Campus Safety Report author. Compile and submit the Annual Campus Safety Report.\n•	Oversee information systems in DPS. Consult as appropriate with ITS in order to optimize information systems and their service to the management of DPS and compliance related issues.\n•	Partner with department leadership to develop useful metrics and reports that contribute to the management of DPS. Ensure the quality of input and proper categorization of data in order to create accurate and useful reports.\n•	Track that all departmental policies and procedures are regularly reviewed and updated. Ensure communication of policies and procedures to all appropriate staff.\n•	Conduct regular audit of the DPS website to ensure content is accurate and current.\n•	Repr', 'Public Safety Associate', '2015-06-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1002, 162, 'Loyola Marymount University', 'Academic Affairs', NULL, NULL, '•	Assist with all aspects of the budget process including accounting, reporting, and financial functions that support Academic Affairs.\n•	Planning and support for the budget development for revenue centers and other special programs. \n•	Conduct research and analysis associated with yearly budget process.\n•	Analyze special academic program financial data including enrollment data, program break even analysis, contract review process, and various other academic program models.\n•	Support the faculty contract process. Verify and maintain the budget information associated with faculty contracts and faculty lines.\n•	Manage the budget for Internal Faculty Grants and faculty stipends.\n•	Prepare and maintain monthly temporary & permanent salary analysis for the areas reporting to the Vice Provost for Academic Affairs including areas reporting to the Associate Provosts. \n•	Assist in the development and implementation of internal controls for Academic Affairs.\n•	Prepare and conduct university bud', 'Budget Analyst', '2014-08-01', '2015-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1003, 162, 'Loyola Marymount University', 'Facilities Management Department', NULL, NULL, '•	Perform cost control accounting functions to effectively use the limited financial resources of the department and university.\n•	Maintain complete cost control for capital purchases and projects.\n•	Maintain various financial reports for capital and operating expense accounts.\n•	Prepare and maintain performance metrics for a number of areas under Facilities Management\n•	Prepare and process invoices and account reconciliations for on-campus projects and service.\n•	Represent LMU at various construction project meetings, job walks with vendors, and at professional organizations or associations.\n•	Assist in day-to-day administration of work order allocation and labor efficiency reporting for Building Management Department.', 'Senior Account Coordinator', '2011-09-01', '2014-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1004, 162, 'California State University, Northridge', 'Hispanic Serving Institutions-Title V Grant Project', NULL, NULL, '•	Work with the Title V Project Director to administer and oversee implementation and operation of all project’s activities including budgets and analytical reporting.\n•	Collect and process time sheets, time and efforts report, progress reports and payment requests.\n•	Assist in coordinating quarterly meetings with component leads and semiannual meetings of Steering Committee and communication with project’s staff, faculty, research analyst, and external evaluator.\n•	Assist in the data collection and preparation of internal reports as well as annual reports to the Department of Education.\n•	Equipment inventory management and tracking of tasks assigned to employees and faculty paid under the grant.\n•	Assist component leads and college leads as needed in achieving project’s goals.', 'Project Coordinator', '2010-01-01', '2012-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1005, 162, 'California State University, Northridge', 'Bookstein Institute and Tax Clinic', NULL, NULL, '•	Generating and preparing financials reports to Federal agencies and the University.\n•	Maintaining budget account ledgers and Office Live client database.\n•	Reporting and analysis of all budget and actual activity for all multimillion tax clinic accounts.\n•	Processing the various financial forms and budget balance statements relevant to the clinic and the MS in Taxation program.\n•	Identifying and developing alliances with community partners, as well as assisting with the development of a marketing campaign.\n•	Administering the day-to-day operations of the Bookstein Tax Clinic and MS in Taxation program.\n•	Experience in managing in an office setting including monitoring and supervising over 50 graduate and undergraduate students at any given time.\n•	Providing interpretation services to low income clients in Spanish.\n•	Facilitating the training of incoming tax clinicians as well as supervising and monitoring their performance.\n•	Supervising student assistants working in the tax clinic o', 'Program Coordinator', '2008-08-01', '2011-09-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
