(1021, 165, 'Gulf Bank', NULL, NULL, NULL, '-Conduct periodic business calls to review the financial needs of clients and opportunities for marketing bank services. \n-Carry out financial and non financial analysis on commercial customers financial statements as part of a complete credit analysis report on new credit requests, and renewal of existing ones. \n-Present to credit committees customers requests for extending or issuing new credit facilities.\n-Establish cash and non-cash credit limits for the customer, and authorise granting the facility, if within their limit, or submits recommendation for approval or disapproval with clear justification to respective Credit Committees. \n-Monitor the performance of accounts within portfolio to detect early signs of trouble in order to achieve higher levels of quality through minimising defaults and provisions.', 'Management Associate - Corporate Banking', '2013-08-01', '2014-04-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1022, 165, 'Institute of Banking Studies', NULL, NULL, NULL, 'Graduated top of the class with a 96.73% grade\n\nA professional banking certificate program aimed to develop the credit department staff in the banking sector, through offering a series of training modules, under the title ‘Certificate in Credit Management’. These modules seek to develop staff who are new to a credit department with no previous credit analysis experience, into competent credit staff.\nObjectives:\n-To familiarize the participants with the fundamental concepts of accounting, the recording of financial information, preparation of trial balances and final accounts, and the effects of accounting policies and methods on financial information provided.\n- To understand the structure of financial statements, the concepts, tools and techniques of financial analysis of business firms.\n-To develop an understanding of the various types of bank credits and their characteristics.\n-To develop an ability to use the concepts, tools and techniques of appraising and monitoring credit propos', 'Certified Credit Manager (CCM)', '2013-01-01', '2013-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
