(1028, 166, 'Apple', NULL, NULL, NULL, 'I am the only female mentor at our store. My goal as a mentor is to see every \'mentee\' accomplish their every goal personal and career related. I have ample knowledge of all Apple products and services as well as all telecommunications companies offerings.\n\nPeople speak about pride of ownership when owning a specific property. I take pride in working at Apple.\n\nI work for Apple because it allows me to serve the \'man\' that brought about change to 5 different industries- Steve Jobs. I feel privileged to have the opportunity and will continue working diligently to continue his legacy.\n\nI have an opportunity to build my skill sets: interpersonal savvy, time management, presentation skills, technical learning, listening, great customer focus, marketing savvy, and mobile technology.', 'Specialist, Mentor', '2013-11-01', '2015-03-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1029, 166, 'Defined Learning', 'dfw', NULL, NULL, 'I gained most of my knowledge base working as a outside sales representative for Defined Learning. I truly understand the climate of urban and suburban schools and their need for project based learning specifically in STEM classes. \n\nWhile working with Defined Learning I visited 100\'s of schools in the DFW metroplex, St. Louis Metropolitan, Greater Los Angeles, and Utah! I now have a wealth of knowledge in curriculum design, user interface design, school sales cycles, common core & TEKS state standards.\n\nDefined Learning is lead by three entrepreneurs from Discovery Education: Joel Jacobson, Johnjoe Faragher, and Rob Eifer. Their background is in media rich educational content and Understanding by Design framework. \n\nI have merged my experience as a sales representative, technology guru, and passionate entrepreneur to support the growth of JonDavid Enterprises from a start up to a game changer in the education market.', 'Outside Sales Representative', '2012-07-01', '2014-04-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1030, 166, 'JonDavid Education', 'Dallas/Fort Worth Area', NULL, NULL, 'JonDavid Enterprises Global, Inc is an educational software distributor. JonDavid’s focus is improving inner city education and equipping all students with the skills to receive a post secondary education and receive a college degree in a STEM field if they so choose. Our mission is to increase the number of minorities and women leaving high school prepared to receive degrees in STEM fields.\n\nJDE has a four member board of directors which includes: Greg Bestick- COO Paradigm Agency/ FMR President of The Learning Company, Ron Parker-CEO Executive Leadership Council, Gerhard Karba- FMR CIO Westfield LLC, and Taylor Shead. The management team includes {CEO-Taylor Shead, President- Gerhard Karba, Business Growth and Development- Kenneth Shead, CFO- Peter Elwell, Legal- Chris O’Brien.}', 'Founder, CEO, Creative Director, Chairman', '2010-06-01', '2016-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
