(1043, 169, 'Liberty Mutual Insurance', NULL, NULL, NULL, 'Led Customer Communication Transformation-Auto Project, delivered successful monthly releases, wrote customer focused, quality requirements with sponsor collaboration, and was the subject matter expert on the Auto Real Time project.  \n•	Facilitated release kick off meetings, project scoping meetings, and captured functional level requirements during requirements gathering sessions for each release.\n•	Collaborated with Sponsors and Product Analysts to improve quality of requirements earlier in the SDLC\n•	Redesigned test plans to better incorporate business requirements, as well as establish testing schedule/ process, requirements traceability, and repeating testing strategies\n•	Delegated and managed testing responsibilities of four contractors each release\n•	Set, drove and achieved weekly testing goals per release\n•	Led daily defect meetings, including daily preparation and distribution of defect report and metrics to team and upper management \n•	Partnered with Publishing Product Suppor', 'Business Systems Analyst II', '2010-10-01', '2012-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1044, 169, 'Liberty Mutual Insurance', NULL, NULL, NULL, 'Active team player focused on coordination of automation efforts for business application testing.  Responsible for test plan design and debug, automation execution, and test strategy improvement.\n•	Managed approximately four to six small projects on SQA team at a time\n•	Lead Project Start Up Sessions, contribute to team project selection and resource budgeting\n•	Trained over 20% of both IT and Business users \n•	Expanded training classes to additional Business Areas within Personal Markets\n•	Developed QC 201 training class & materials for advanced users\n•	Led four hour training sessions throughout the year to ensure consistency & user knowledge\n•	Design automated test plans, execute and debug test sets for critical business functionality\n•	Established and delivered an improved monthly regression testing with updated quote creation process and query execution, reducing cycle testing time 78% \n•	Authored and published standardized department documentation, managed within SharePoint\nActed', 'Quality Assurance Analyst', '2008-08-01', '2010-10-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
