(1123, 182, 'Chronicle Books', 'San Francisco Bay Area', NULL, NULL, 'In addition to continued management of the company’s domestic subsidiary rights channels, I managed the department\'s month-end financial process and select foreign rights territories. I represented Chronicle Books at key foreign book fairs in Frankfurt, Bologna, and London, following up on all leads from those fairs. \n\nAchievements:\n\nPresented compelling and concise story pitches in one minute or less per Chronicle title in over 40 meetings in 4 days at key international book fairs in Bologna, London, and Frankfurt, strengthening customer relationships and maximizing sales for the department. \n\nExceeded school book fair goal resulting in best year ever for Chronicle in that channel.\n\nCommunicated monthly summaries of financial data to Chronicle’s executive team, successfully identifying strengths, weaknesses and sales opportunities.\n\nLed internal company-wide presentations summarizing international book fair results, customer feedback on titles, and YTD financials.\n\nLed conception and ', 'Subsidiary Rights Manager', '2016-01-01', '2018-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
