(1125, 182, 'Chronicle Books', 'San Francisco Bay Area', NULL, NULL, 'Coordinated all administrative tasks for the Subsidiary Rights Department including contract routing, galley and advance copy submissions, payment tracking, and database maintenance. \n\nManaged the department’s marketing efforts including crafting content for social media accounts, rights guides, flyers, pamphlets, and newsletters.  \n\nAchievements:\n\nManaged foreign rights sales in Mainland China and Eastern Europe after only six months since starting my position. Exceeded sales goal in these territories over year prior. \n\nCoordinated reprints for foreign rights customers in all territories, successfully identifying opportunities to reduce unit costs and increase gross margins.\n\nProject managed and communicated deadlines to internal teams including marketing communications a, editorial, and design to create rights guides, PowerPoint presentations, and marketing materials for key international books fairs in Frankfurt, Bologna, and London.  \n\nDeveloped, wrote, and edited persuasive copy f', 'Subsidiary Rights Coordinator', '2011-01-01', '2013-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
