(1209, 195, 'Picnic Time Family of Brands', 'Moorpark', 'CA', NULL, 'I served in a highly collaborative role with the Key Accounts and Warehouse Shipping teams to streamline order processing for a manufacturer specializing in outdoor recreational and leisure products. I\'m accountable for overseeing the Bulk Order Program processing for Domestic National Programs, performing compliance chargeback research, and instructing the Order Fulfillment Team for bulk order packing, staging, and shipping.\n\n» I gathered and presented shipping quotes from transportation partners for department supervisor review and selection. \n\n»I processed orders within the in-house ERP system; supply documents for team usage including assembly and pallet sheets, packing lists, BOL’s, and shipping labels.\n\n» I assisted with chargeback research on past shipments as needed.', 'Logistics Solutions Administrator', '2017-01-01', '2019-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1210, 195, 'Picnic Time Family of Brands', 'Moorpark', 'CA', NULL, 'I provided exceptional customer service and sales support for the company’s newer International division offering product to Canada, Latin America, and Europe. Quickly processed orders for clients interested in branded and high-end products; met aggressive deadlines to ensure a positive company reputation. \n\nSignificant contributions include:\n\n? I was a key team member involved with the creation of Picnic Time’s Amazon Third Party Store in Europe.  \n\n? I was kept on the team after the company’s decision to disband the European Operations Division; I was hand-selected for the Key Accounts Administrator role in October, 2017.', 'International Sales Support Representative', '2016-01-01', '2017-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1211, 195, 'Starbucks', 'Thousand Oaks', 'Pasadena & Moorpark', 'CA', 'I proudly served within 2 roles for 3 different Southern California high volume, retail store locations. \n\n? I used my extensive product knowledge to engage and upsell customers whenever possible.\n\n? I handled monies, performed inventory control, helped my managers track overall store operations, and maintained cleanliness and safety standards at all times.\n\nSome of my key achievements include:\n\n? I was hand-selected to participate in the company’s Manager Training Program; I completed project work focused on P&L analysis and potential store weaknesses.\n\n? I was originally hired into the company as a Barista in Pasadena, was transferred to Thousand Oaks in 2007, then promoted to Shift Supervisor and transferred to the Moorpark location in 2009. I was rehired into the Moorpark facility as a Barista in 2014 after attending college.', 'Shift Supervisor/Barista', '2014-01-01', '2016-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1212, 195, 'PennyMac Loan Services, LLC', 'Moorpark', 'CA', NULL, 'I acted as an effective liaison between PennyMac and tax collecting agencies to ensure property tax payments were received and processed on time. I was responsible for efficiently addressing homeowner requests and concerns via mail and fax.\n\n? I performed escrow analyses, converted accounts from non-escrow to escrow, and verified tax information through parcel and legal document searches.', 'Tax Payment Processor', '2013-01-01', '2015-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1213, 195, 'PennyMac Loan Services, LLC', 'Moorpark', 'CA', NULL, 'I served in a highly analytical role providing extensive file review and database entry for key loan documents to ensure proper loan file completion. Used MERS & Freddie Mac Exclusionary lists to complete reviews; actively identified discrepancies and error trends. \n\nNoted accomplishments include:\n\n? I was 1 of 5 selected out of 35 total employees to stay within the company in a new department after group disbanded due to outsourcing positions to India.', 'Data Integrity Specialist/File Receipt Technician', '2012-01-01', '2013-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1214, 195, 'Bank of America', 'Westlake Village', 'CA', NULL, 'I was accountable for managing a specific portfolio of foreclosed properties and serving as an effective liaison between the BAC Field Services team and Investors.\n\n» I personally visited distressed/abandoned properties to secure and assess dwellings to monitor potential code violations and maintain property values.\n\n» I reviewed and tracked preservation history for each property to ensure timely maintenance.', 'Property Preservation Specialist II', '2011-01-01', '2011-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1215, 195, 'Northwestern Mutual', 'Woodland Hills', 'CA', NULL, 'I worked within Maribel Zisch’s office within the Beer Financial Group representing Northwestern Mutual as an Office Administrator and Customer Service Manager. \n\n? I helped prospect and generate new business by creating and implementing innovative marketing strategies.\n\n? I scheduled in-office client meetings and prepped all related presentation and take-away materials.\n\n? I collaborated with company underwriters to process new applications and obtain approval on life insurance and disability policies.\n\n? I trained 1 onboarding employee on the applications process in order to concentrate on new business.', 'Client Relations Director', '2011-01-01', '2012-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1216, 196, 'AXS', 'Los Angeles', 'California', 'United States', '• Responsible for creating a pipeline of new business for AXS through the conceptualization of strategic integrations and ancillary services that complement the live entertainment experience.\n• Currently collaborating with companies such as PayPal to integrate digital payment methods into our ticketing experience, American Express for custom cardmember experiences, and Allianz Global Assistance to offer ticket insurance coverage to event-goers. \n• Lead strategic planning sessions with internal business units such as Content & Marketing, Product, Finance, Client Services, and Engineering to uncover new opportunities.\n• Collaborate with Product Management and Engineering to get placement on the roadmap and drive the necessary tech initiatives to build and support new ancillary features and custom integrations.\n• Work with Business Development and Sales to negotiate rev-share opportunities with sponsorship partners, venue clients, and sports teams.\n• Serve as a subject matter expert on th', 'Director, Sponsorship Strategy', '2017-07-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1217, 196, 'AXS', 'Greater Los Angeles Area', NULL, NULL, '• Responsible for overall E-Commerce strategy and roadmap planning related to the AXS ticketing platform.\n• Product owner for the “Event Shopper” web application which powers the online ticketing experiences for major venues throughout the world including the Staples Center, the O2 arena in London, the Colosseum in Las Vegas, and many others.\n• Responsible for third party integrations with companies such as Stubhub, American Express, Anheuser Busch, and many others to help generate incremental sponsorship revenue as well as deliver additional value for fans of live entertainment.\n• Responsible for gathering, documenting, and prioritizing requirements from various sources such as ticketing operations, venue box offices, concert promoters, and customers to fuel the product backlog.\n• Work within an agile process to drive iterative development across multiple ticketing platforms.', 'Director of Product Management, E-commerce', '2012-01-01', '2017-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1218, 196, 'Ticketmaster', 'Greater Los Angeles Area', NULL, NULL, '• Was tapped to spearhead the development of a new client-facing portal to support Ticketmaster\'s platform re-architecture project.\n• Collaborated with executive leadership to define the product vision and strategy.\n• Documented all business and product requirements utilizing established best practices.\n• Utilized a 3rd party design firm to expedite UEX and interface design work.\n• Worked closely with Web Development, QA, and Web Ops to shepherd the product through all phases of the development lifecycle. \n• Engaged with internal IT department to perform security scans and code reviews to ensure the site was secure and PCI compliant.\n• Collaborated with internal teams to define support strategy, produce training materials, and execute client-rollout.\n• Successfully launched a beta version of the site with six fully integrated ticketing apps in Q4 2011.', 'Director of Product Management - Client Portal', '2010-11-01', '2012-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1219, 196, 'Ticketmaster', 'Greater Los Angeles Area', NULL, NULL, '• Supported the Live Nation/Ticketmaster merger by planning various aspects of the migration of livenation.com from CTS Eventim to the Ticketmaster Host platform.\n• Product managed ticketmaster.com with a special emphasis on the checkout flow.\n• Defined and drove the implementation of numerous feature enhancements related to Ticketmaster\'s billing interfaces, confirmation page, and up-sell/offering tools.\n• Responsible for general site maintenance of ticketmaster.com including its internationalized versions.', 'Sr. Product Manager, E-commerce', '2010-04-01', '2010-11-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
