(1221, 196, 'EarthLink', 'Pasadena', 'CA', NULL, '• Product managed several of EarthLink’s core software products and web properties including their Total Access connection software, My Account website, Personal Start Page, and many others.\n• Responsible for the strategy, feature set, and business objectives of each product within my portfolio.\n• Maintained multiple product roadmaps and presented to internal groups as needed.\n• Authored highly detailed Product Requirements Documents for new features and enhancements.\n• Initiated usability testing to refine and develop compelling product features.\n• Reviewed and analyzed product reports for performance, profitability, and customer satisfaction.', 'Product Manager', '2002-02-01', '2007-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
