(1237, 199, 'SalesHive.com', 'Greater Denver Area', NULL, NULL, 'In early 2022 had a successful exit.\n\nSalesHive is a B2B Sales Development Agency backed by a proprietary technology platform that uses email, social media and direct mail to book meetings with qualified buyers in your target market. SalesReply’s diverse service offering allows companies to scale rapidly without hiring additional reps or investing in expensive technologies and data resources. To learn more, visit SalesHive.com', 'Co-Founder and Chief Revenue Officer', '2019-09-01', '2022-04-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1238, 199, 'Pipestry', 'Greater Los Angeles Area', NULL, NULL, 'In 2019 Pipestry rebranded to SalesHive.\n\nPipestry is your sales development team.\nWe help entrepreneurs and growing B2B companies accelerate pipeline growth by providing sales development experts to execute sales outreach at a fraction of the cost and time. Started by two customer acquisition specialists from high growth companies, Pipestry uses the latest prospecting strategies and technologies to build quality pipeline and scale outreach.\n\nOur Account Based Sales Development Services Include:\n\n* Creating a custom tailored Sales Development Playbook\n* List building\n* Contact research\n* Account mapping\n* Message crafting\n* Outreach activity\n* Response handling\n* Meeting scheduling\n* A/B testing\n* Nurturing\n\nPipestry uses the latest prospecting technology and covers the cost of all tools and contact data.', 'Co-Founder and Chief Sales Strategist ', '2016-05-01', '2022-04-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1239, 199, 'Pledgeling', 'Greater Los Angeles Area', NULL, NULL, 'Achievements \n• Built a sales and outreach program from scratch for new start-up still discovering fit in market\n• Assisted in jumping sales 223% from Q1 to Q2\n• In first 3 months of outreach generated nearly 50 meetings with top prospects and brands\n• Created repeatable sales process and outreach program\n• Created value proposition, sales playbooks, and set-up and built Salesforce', 'Director of Business Development', '2016-01-01', '2016-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
