(1261, 202, 'Thoracent', 'Minneapolis', 'Minnesota', 'United States', 'Founded in 2017, Thoracent develops and commercializes medical devices with a focus on Interventional Pulmonology and Thoracic Surgery. Thoracent is the exclusive U.S. distributor of the Bonastent tracheobronchial stent and the MicroTech Y Stent. \nThoracent is headquartered in Long Island, New York and has a strong sales team located across the US. The company has experienced rapid growth and was ranked #17 on the 2021 INC 5000 list of fastest growing companies in the New York Region. In late 2020, Thoracent expanded to Minneapolis, opening a south-metro office.', 'Chief Financial Officer', '2020-02-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1262, 202, '4 Oranges', 'El Segundo', 'California', NULL, '4 Oranges is a management consulting firm created to assist small business CEOs with corporate strategy (finance, operations, and marketing). As a temporary expert on your team, we focus on creating a strategy for your business and implementing that strategy through marketing, research, and financial analysis. We work alongside small business owners in a consulting capacity to help you run your business more efficiently and more profitably.', 'Management Consultant', '2017-05-01', '2020-02-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1263, 202, 'Grandpoint Bank', 'El Segundo', 'California', NULL, '(Grandpoint Bank was a community bank in Los Angeles. They were acquired in 2018 by Pacific Premier Bank.) \nMy role was to originate and underwrite complex middle market business, construction and commercial real estate loans in Southern California and to maintain performance of the loan portfolio.', 'Vice President, Senior Underwriter', '2013-08-01', '2017-11-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14');
