(1264, 202, 'Colony Capital, Inc.', 'Los Angeles', 'California', NULL, 'Colony Capital, Inc. is a leading global real estate and investment management firm that creates long-term value through investing in real estate and real estate-related assets. As a senior asset manager, my role was to maximize returns on my assigned portfolio of non-performing assets by negotiating payment agreements, selling portfolio assets, or pursuing legal action. I exceeded the portfolio goals by achieving a 31% IRR and equity multiple of 1.76.', 'Senior Asset Manager', '2011-03-01', '2013-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1265, 202, 'VFSC', 'Eden Prairie', 'Minnesota', NULL, '(Voyager Bank/VFSC was a Minneapolis-based community bank. They were acquired by Anchor Bank. Anchor Bank is now Old Republic Bank) \nMy role was to manage the bank\'s portfolio of problem credits including negotiating settlements, structuring loan workouts, foreclosing on collateral, managing and selling bank owned properties, and collecting on charged-off accounts. The majority of the portfolio was completely resolved within 18 months. I also created and implemented the bank\'s commercial real estate stress testing program which involved identification of at-risk concentrations, determination of loan loss reserve level adequacy, and recommendations for portfolio monitoring.', 'Vice President of Special Assets', '2009-01-01', '2011-03-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1266, 202, 'Marshall Group', 'Minneapolis', 'Minnesota', NULL, 'Origination and portfolio management of nationwide commercial real estate construction loans, ranging in size from $10MM to $60MM.  Managed a $200MM loan portfolio including tracking performance and real estate trends, processing construction draws, completing quarterly/annual reviews, and working with Participant banks.', 'Portfolio Manager', '2005-01-01', '2008-10-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
