(1281, 205, 'Pipestry', 'Greater Los Angeles Area', NULL, NULL, 'Pipestry is your sales development team.\nWe help entrepreneurs and growing B2B companies accelerate pipeline growth by providing sales development experts to execute sales outreach at a fraction of the cost and time. Started by two customer acquisition specialists from high growth companies, Pipestry uses the latest prospecting strategies and technologies to build quality pipeline and scale outreach.\n\nOur Account Based Sales Development Services Include:\n\n* Creating a custom tailored Sales Development Playbook\n* List building\n* Contact research\n* Account mapping\n* Message crafting\n* Outreach activity\n* Response handling\n* Meeting scheduling\n* A/B testing\n* Nurturing\n\nPipestry uses the latest prospecting technology and covers the cost of all tools and contact data.', 'Director Of Operations', '2018-01-01', '2019-09-30', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
