(1284, 205, 'Pledgeling', 'Venice', 'CA', NULL, 'Pledgeling is the world\'s first SaaS platform to power purpose & impact for brands to drive growth and build stronger relationships with their customers. Our end-to-end solution empowers brands to find their social purpose, engage their audiences, and make actionable impact in a world where what you stand for is as important as your products, services and culture. www.pledgeling.com #PledgeToDoGood\n\nCustomer Service Coordinator:\n? Provide customer support via email, voice, and other channels;\n? Enhance the company’s support presence via new or improved\nsupport articles;\n? Verify new nonprofit organizations for addition to the database, and help\ndevelop ways to make this process more efficient.\n? Keep other staff up to speed on Salesforce Desk and other tools so that they\ncan step in as needed.\nMedia Production Specialist:\n? Assist marketing, sales, and other staff with video and other\nproduction assistance as needed.', 'Customer Service Coordinator; Media Production Specialist', '2016-10-01', '2017-05-31', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
