(1371, 217, 'One Love Foundation', 'Oakland', 'California', 'United States', 'One Love is leading a movement for relationship health that can change the statistics around relationship abuse and build a world where all #lovebetter. Understanding that nothing is more important than the health of our relationships, we are working to develop standardized education focused on our Ten Signs of Healthy Relationships and Ten Signs of Unhealthy Relationships. The goal? Make sure every young person can spot the signs before they become abuse and also take the steps they need to be healthier every day. Our One Love Education Center is an open access training portal that anyone anywhere can access to be trained in our film-based workshops and other tools. Join us!', 'Executive Director, California', '2021-06-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
