(1387, 219, 'iPerformX', 'Irvine', 'California', 'United States', 'At iPerformX, our mission is to accelerate training outcomes by providing students and their instructor\'s access to the right message to the right person at the right time.   The iPerformX Ecosystem harnesses artificial intelligence coupled with performance data management and machine learning to deliver adaptive training solutions that accelerate both student and instructor pilot performance.   \n\nWe’ve been developing cognitive training programs for over fifteen years. Our research suggests that addressing individual students\' learning needs based on closely monitoring their training activity and biometric performance shows promise to accelerate proficiency over time.\n\nPowerful analytics measure performance for students and instructors to inform training efficacy.\n\nInstructors can optimize curriculum, work one-on-one with students in digital break-out sessions, and moderate learning accelerators created by AI to optimize training efficacy.\n\nMachine learning analyzes student and instru', 'Product Manager', '2022-08-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1388, 219, 'NEOGOV', 'Greater Los Angeles Area', NULL, NULL, 'As a Senior Product Manager at NEOGOV, I work extensively with customers and cross functionally with Product, Marketing, Engineering, Sales, and Customer Success to successfully prioritize features and build world class products that customers need and want.', 'Senior Product Manager', '2017-10-01', '2022-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1389, 219, 'Advantage Sales & Marketing', 'El Segundo', 'CA', NULL, 'Lead a product management team through identifying, defining, and delivering new in-house products that support the sales & marketing tactics offered by Advantage.  These products are used to provide client service teams with a competitive advantage as they work with  major retail partners such as Walmart, Kroger,  Albertsons, and Meijer.\n\nThe team I\'m on has successfully introduced an agile/scrum approach to enterprise IT project management and continuously delivers on-time, under budget and above expectations.  This position is a blend of product management, meeting with the business owners to align customization to their needs as well as an administrative/development role requiring a deep knowledge and understanding of out of the box Microsoft Dynamics CRM and custom .NET applications.\n\nResponsibilities include owning the product requirements backlog, writing user stories with detailed acceptance criteria, defining and communicating a product roadmap, managing and mentoring business', 'IT Senior Product Manager', '2014-06-01', '2017-09-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1390, 219, 'Orange County United Way', 'Irvine', 'CA', NULL, 'Consult the Company during the initial installation and organizational adoption of a Customer Relationship Management (CRM) system utilizing Microsoft Dynamics CRM.  \nLearn process flows and gather business requirements for consumer web solutions across functional areas, including sales, marketing, development, finance, and community building.', 'Application Development Consultant', '2013-08-01', '2014-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1391, 219, 'United Way of Greater Los Angeles', 'Greater Los Angeles Area', NULL, NULL, 'Serve as hands-on program manager and implementation lead for the Company\'s Customer Relationship Management (CRM) system using Microsoft Dynamics CRM.\nGather business requirements for consumer web solutions across functional areas, including sales, marketing, development and community building.\nProvide business insights via data querying and analysis to lead customer driven product and process development initiatives.', 'Application Development Consultant', '2013-08-01', '2014-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1392, 219, 'Payoff.com', 'Greater Los Angeles Area', NULL, NULL, 'Shaped the business strategy for the core product at Payoff.com:  applying \"gamification\" to teaching financial literacy and affecting people\'s behavior around debt management and personal finance.  Worked cross-functionally with executives, design, project management, engineering and quality assurance to define and prioritize product features.    Owned the product backlog and led agile/scrum process.  Integrated customer feedback, user metrics, and application usage data into key performance indicator dashboards used to track overall product health.', 'Senior Product Manager', '2012-07-01', '2013-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
