(1394, 219, 'DreamWorks Animation', NULL, NULL, NULL, 'Producer of Kung Fu Panda World (http://kungfupandaworld.com) a flash-based kid-safe MMO (massively multi-player online) virtual world.\n• Manage a distributed development team comprised of multiple vendors through game design, art direction, technical development, QA testing & production deployment of all game features to a managed hosting facility.\n• Led weekly analytics review of inbound traffic and correlated user behavior to targeted conversion goals. Adjusted product f\nfeatures & campaigns to maximize key performance metrics.', 'Producer - Virtual Worlds', '2009-10-01', '2012-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
