(1396, 219, 'Amp\'d Mobile', NULL, NULL, NULL, 'Amp’d Mobile Overview\n\nAmp\'d Mobile is the first integrated mobile entertainment company for youth, young professionals and early adopters, and the only 3G carrier in the U.S. specifically targeting that demographic. By leveraging the power of broadband wireless (EVDO), Amp\'d Mobile offers traditional services such as voice and text within a completely fresh user interface designed specifically for the \"mobile graduate\" and third-generation (3G) technology. With a myriad of customizable options to meet each person\'s individual needs, as well as strategic alliances with top entertainment properties, such as MTVN and Universal Music Group, Amp\'d Mobile brings a more relevant, personal experience to the wireless lifestyle with unique music, video, community, entertainment, sports and gaming offerings divided into various channels for quick and easy access. Amp\'d Mobile is offered nationwide and more information can be found at www.ampd.com.', 'Program Manager, Amp\'d UI', '2006-06-01', '2007-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
