(1417, 222, 'Digital Knack', 'Greater Los Angeles Area', NULL, NULL, 'The DK Apprenticeship Program is a program that combines mentorship, hands on training and skills based learning for young professionals with perseverance, drive and passion within the digital media and technology space. The program dedicates a specific area of focus for each apprentice, determined by the career interest of the apprentice.\n\n•	Supported candidate sourcing for a top client, focusing on technical positions for a machine learning, big data company. Sourcing required strategic research, talent assessment and data management.\n•	Helped create and deploy annual direct mail campaign designed for contact appreciation, targeting candidates and clients. Support included messaging, packaging and data management.\n•       Collected, prepped and imported data into Salesforce to track job opportunities.\n•	Social media management; content distribution through HootSuite for Twitter, LinkedIn & Facebook.', 'DK Apprenticeship Program | Marketing & Candidate Sourcing', '2015-09-01', '2015-12-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1418, 222, 'Loyola Marymount University', 'Greater Los Angeles Area', NULL, NULL, '•	Assessed LMU’s marketing strategy for engaging prospective students within the MBA program and analyzed qualitative/quantitative results of efforts to date for a comprehensive view of their existing practices and impact.  \n•	Fostered prospective student relationships and increased enrollment.\n•	Collaborated with MBA Marketing Team to enhance the marketing strategy for prospective students which included:\no	Developing strategy and implementing digital ad programs, which increased the MBA site traffic by 10%.\no	Creating & managing the Customer Relationship Management (CRM) system, devising baseline performance metrics, and collecting more concise data about perspective students. Grew the company’s contact database from non-existent to holding 2,000 contact records, enabling an increase in marketing reach and engagement. \n•	Served as the MBA Program Ambassador for information sessions every month. Participation included, public speaking – answering Q&As of potential students, serving as', 'Graduate Research Assistant', '2013-01-01', '2015-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
