(1456, 229, 'IUCN', 'Suriname-Guyana Triangle', 'Guyana', NULL, '?	Produced Suriname and Guyana’s Reducing Emissions from Deforestation and Forest Degradation (REDD+) and Forest Law Enforcement, Governance and Trade (FLEGT) policies situation report submitted to the European Union.\n?	Implemented and organized community monitoring systems in 12 indigenous communities. \n?	Recruited and hired eight consultants and defined their scope of activities and responsibilities.', 'Monitoring Specialist for Guyana and Surinam partners of The Amazonia 2.0 project.', '2020-06-01', '2021-08-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
