(1458, 229, 'FSC ECUADOR', 'Ecuador', NULL, NULL, '?	Led and managed five projects resulting in the FSC’s certification of 57,000 hectares of forests.\n\n?	Designed innovative strategic plan leading to the membership’s approval of Ecuador’s first national standards for forest certification, ending nine years of unproductive negotiations.', 'National Coordinator, Forest Stewardship Council (FSC)', '2009-11-01', '2013-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1459, 229, 'Earth Law Center', 'Washington', 'District of Columbia', 'United States', '?	Designed and drafted amicus curiae to defend the rights of nature in the pioneering Los Cedros, Bosque Protector case, chosen for argument before the Ecuadorian Constitutional Court in order to produce the first jurisprudence decision establishing the rights of nature as plaintiff. \n\n?	Led drafting of high-profile amicus briefs seeking an injunction from Ecuador’s Constitutional Court directing the HIDROTAMBO hydroelectric plant to restore the Dulcepamba River.\n\n?	Led drafting documentation for “Los Mecheros”, case brought by indigenous peoples to stop the use of open-air petroleum well gas flaring which harms the lives of thousands of children and families in the Ecuadorian Amazon.', 'Environmental and Forest Policy Expert', '2018-11-01', '2021-09-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
