(1461, 229, 'Fondo para la Protección del Agua - FONAG', 'Ecuador', NULL, NULL, '?	Negotiated environment-restoration agreements with two oil pipelines (OCP, SOTE) and two electricity companies (EEQ, TRANSELECTRIC). \n\n?	Prosecuted eight high-profile criminal actions seeking precedent-setting enforcement of environmental laws.  \n\n?	Developed and implemented environmental law training programs for park rangers of FONAG.', 'In-House Counsel, Fund for the Protection of Water of Quito (FONAG), January 2016 to December 201', '2017-01-01', '2017-12-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1462, 229, 'MINISTERIO DEL AMBIENTE ECUADOR', 'Ecuador', NULL, NULL, '?	Obtained over $80 million in funding from the GCF (Global Climate Fund) and the GEF (Global Environmental Facility) for three separate conservation projects.\n\n?	Led negotiation and design of first uniform agreement authorizing scientific research with access to genetic resources. \n\n?	Designed Ecuador’s national programs in forest-traceability and established a national Monitoring, Reporting and Verification System to protect forests. \n\n?	Developed a national regulatory framework authorizing the criminal prosecution of environmental cases under CITES, the Red List of IUCN and Ecuadorian Criminal Code.', 'Undersecretary, Natural Heritage', '2014-07-01', '2015-11-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1463, 229, 'Asamblea Nacional del Ecuador', 'Ecuador', NULL, NULL, '?	Led design and drafting of national statutory framework for territorial zoning, governance, and jurisdiction across all levels of government. \n\n?	Designed and drafted national legislation limiting urban development and establishing national planning and construction standards.', 'Rapporteur, Commission of Autonomous Governments of the National Assembly of Ecuador.', '2013-06-01', '2014-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
