(1727, 271, 'Pierce Law Group LLP', 'Beverly Hills', 'California', 'United States', '• Worked directly under David Pierce to draft COVID-19 guidelines for the resuming of production for studios to use, with materials being distributed at the 2020 USC and BHBA Institute on Entertainment Law and Business\n• Represented clients facing copyright infringement, employment disputes, and other issues regarding intellectual property\n• Drafted legal memoranda, short term financing agreements, requests for discovery, requests for production, chain of title, direction letters, and motions to quash on behalf of clients\n• Redlined option purchase agreements, distribution agreements, representation agreements, clearance reports, long form financing agreements, and deal memoranda\n• Listened to client meetings and attorney negotiations and spoke with representatives from SAG-AFTRA on behalf of a client', 'Summer Associate and Law Clerk', '2020-05-01', '2020-12-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
