(1768, 277, 'City Year', 'Chicago', 'Illinois', NULL, 'The purpose of my Corps Member position in City Year is to work one on one with students in the areas of attendance, behavior and course performance in order to bring them back up to grade level in grades and test scores. This aligns overall with City Year\'s mission of reducing the high school drop out rate.\n\nTutored 16 students for at least 45 minutes per week that have been deemed as below grade level in reading and writing. Mentored 6 students in developing socio-emotional and leadership skills in twice weekly structured lunch sessions to improve behavior. Coached 6 students with weekly goal setting and positive incentives in order to improve average daily attendance rates. Also served as the Evaluation Coordinator for the school team, on the Corps Council and Service Reserves.', 'Corps Member', '2013-08-01', '2014-06-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14');
