(1769, 277, 'Loyola Marymount University', 'Los Angeles', 'California', NULL, 'The purpose of my position as Research Assistant at Loyola Marymount was to assist in the design, implementation, collection, analysis and presentation of various research projects under the advisory of Dr. Ricardo Machón within the Psychology Department.\n\nDesigned, distributed, administered, and collected of over 200 research surveys. Analyzed over 200 respondents’ responses to an 80-item survey in an effort to reveal empirical evidence in support of a detailed research question. Wrote portions of the formal APA formatted manuscript used to report findings of the study. Formally presented findings to an audience of over 100 esteemed academics within the field of psychology at the International Federation of Catholic Universities’ 4th International Conference in Psychology in Buenos Aires, Argentina.', 'Research Assistant', '2010-10-01', '2013-07-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
(1770, 277, 'Loyola Marymount University', 'Los Angeles', 'California', NULL, 'The purpose of my position as Student Administrator for the Human Subject Pool within Loyola Marymount University\'s Psychology Department was to facilitate and maintain the sign-up process of participants in student and staff research projects within the department.\n\nActed as a liaison between faculty and student researchers and 200-600 general psychology students in order to facilitate a smooth sign-up and participation process in departmental research studies on a semesterly basis. Reviewed student and faculty researcher applications for use of the Human Subject Pool. Set up and managed Sona-Systems, an online sign-up management system, on a semesterly basis in order to facilitate and organize student participation sign-ups. Presented the sign-up and participation process in 2-5 introductory psychology course classrooms per semester in order to clarify the process for students.', 'Student Administrator for the Human Subject Pool', '2009-09-01', '2013-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
