(1897, 295, 'Vida Verde Farms CBD', 'California', 'United States', NULL, 'At Vida Verde Farms we are determined to preserve the high quality standards of our products. Which is why all of our hemp is grown and processed in the USA. We grow, extract, bottle and distribute our products. It allows us to control supply chain, thus, ensuring there is no break down from the genetics we grow all the way to the CBD product you purchase.\n\nOur mission is to provide our clients with the highest grade Hemp Cannabidiol (CBD) based products on the market using the best harvesting practices from seed to final product that would yield the highest CBD content. We strive to make products that can help people with chronic pain, anxiety and improve general health and well being.', 'CBD Product development/ Brand Manager', '2019-07-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
