(1901, 295, 'De Anda Trucking, LLC', 'United States & Mexico   www.deandatruckingllc.com', NULL, NULL, 'De Anda Trucking LLC is an international company that delivers its services both in Mexico and the United States.  Their offices are located in Calexico, California and Mexicali, Baja California Mexico.  De Anda Trucking, LLC is a company dedicated to the transportation of merchandise who is always attentive to actualizations in their Trucking system in order to offer a high quality service to all of their customers; in the same way they aim to improve their employees’ working conditions to obtain their permanence with the organization.  This company is dedicated to the transportation of merchandise with door-to-door delivery services. One of the competitive advantages that De Anda Trucking LLC has, is their mission to become the primary option for their customers in base of their trustworthiness, attention and personalized services accomplishing 100% on-time deliveries.  The company’s main activity is the transportation of industrial and food products; De Anda Trucking LLC counts with', 'Manager-Traffic & Logistics', '2012-08-01', '2017-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
