(1904, 295, 'LMUCC', 'Los Angeles', 'CA', NULL, 'High Quality Children Center\n\nLoyola Marymount Children Center\nLMUCC is a non-profit organization dedicated to providing high quality care for children 6 weeks to 5 years of age.  It is licensed by the State of California, Department of Social Services, Community Care Licensing division and most recently, LMUCC achieved accreditation from the National Association for the Education of Young Children (NAEYC), an honor bestowed upon less than 8% of childcare centers nationwide. \n\nTheir Mission\nLMUCC supports the University\'s mission by caring for the children of its faculty, staff, students and community and furthering the University\'s mission of social justice.  It is their belief that our society can achieve its optimal potential when they ensure educational equality for all, beginning at infancy. The core tenet of LMUCC and its success lies in relationships. LMUCC believes that positive, caring relationships between a child and the significant adults in his or her life are vital to qua', 'Caregiver / Teacher\'s Aid', '2008-09-01', '2012-05-01', 'N', '2024-01-26 22:44:14', '2024-01-26 22:44:14'),
