(2057, 23, 'Charter Communications', 'Denver', 'Colorado', 'United States', '•	Oversee efforts to accurately track AWS costs by enforcing tagging standards and training teams on the value of data tagging, thus decreasing untagged resources by 64% across 5 teams.\n•	Harness complex queries in Athena and Druid to build insightful Tableau dashboards for the executive team, helping them identify areas where AWS costs can be further streamlined.   \n•	Utilize Imply Pivot to create a dashboard using Druid data to help on call developers resolve data availability issues, and identify patterns in the data to prevent future data outages.\n            \n\n    \n    \n\n    \n        Show less', 'Business Intelligence Analyst', '2022-01-01', '1700-01-01', 'N', '2024-01-26 22:44:14', '2024-01-27 18:21:55'),
